import { Link, Page } from 'components';
import React from 'react';

export const Home: React.FC = () => {
  return (
    <Page>
      HTML+
      <ul>
        <li>Docs</li>
        <li>Pricing</li>
        <li>Components</li>
        <li>v1.2.7</li>
      </ul>
      <ul>
        <li>github</li>
        <li>twitter</li>
        <li>instagram</li>
      </ul>
      <Link to="ROUTE:COMPONENT:DETAILS" params={{ key: 'switch' }}>
        GO TO UI COMPONENTS
      </Link>
    </Page>
  );
};
